10.August.2021 This is a Mariola appreciation post! I was first paired with @mariolazysk at my first Olympics as a broadcaster & every since I have had the tremendous honor of sharing her artistic talents & creativity with the world. My Closing Ceremony hairstyle was inspired by the Olympic cauldron & the five Swarovski rings she carried to Tokyo from New York. She helps me put on a show & is a dear friend and confidant who I am lucky to spend a big part of my life with. I appreciate all your messages about my hair, but all the applause should go to her! Thank you Mariolochka! 🤍
@nbcolympics @actonstylegroup 
#hair #olympics #tokyo

9.August.2021 ありがとうございました! I never forget how lucky I am to live out my dreams with these two incredible people. Please join us at 8 eastern for our coverage of the Closing Ceremony on NBC! I hope you smile!
@taralipinski @terrygannon83 
#olympics #tokyo #closingceremony
